const cheerio = require("cheerio");

import ambilHtml from './ambilHtml.js'
import extractDeal from './extractDeal.js'


async function getCuaca (req, res) {
        const steamUrl =
        "https://store.steampowered.com/search/?filter=weeklongdeals";
        const html = await ambilHtml(steamUrl);
        const selector =  cheerio.load(html);
        const searchResults = selector("body")
        .find("#search_result_container > #search_resultsRows > a"); 
        const deals = searchResults.map((idx, el) => {
            const elementSelector = selector(el);
            return extractDeal(elementSelector);
        })
        return deals;
};
